import React from "react";
import ReactDOM from "react-dom";
import { createBrowserHistory } from "history";
import { Router, Route, Routes, useRoutes, Navigate } from "react-router-dom";

import "assets/scss/material-kit-react.scss?v=1.10.0";

// pages for this product
import Components from "views/Components/Components.js";
import LandingPage from "views/LandingPage/LandingPage.js";
import ProfilePage from "views/ProfilePage/ProfilePage.js";
import LoginPage from "views/LoginPage/LoginPage.js";

import DashboardLayout from "views/DashboardKIA/layouts/dashboard";
import DashboardApp from "views/DashboardKIA/pages/DashboardApp";
import User from "views/DashboardKIA/pages/User";
import Products from "views/DashboardKIA/pages/Product";
import Blog from "views/DashboardKIA/pages/Blog";
import NotFound from "views/DashboardKIA/pages/NotFound";

var hist = createBrowserHistory();

let RouteDashboard = useRoutes([
  {
    path: "/dashboard",
    element: <DashboardLayout />,
    children: [
      { element: <Navigate to="/dashboard/app" replace /> },
      { path: "/dashboard", element: <Navigate to="/dashboard/app" /> },
      { path: "app", element: <DashboardApp /> },
      { path: "user", element: <User /> },
      { path: "products", element: <Products /> },
      { path: "blog", element: <Blog /> },
      { path: "404", element: <NotFound /> },
    ],
  },
  {
    path: "/",
    element: <LandingPage />,
    children: [{ element: <Navigate to="/landing-page" replace /> }],
  },
  { path: "*", element: <Navigate to="/404" replace /> },
]);

ReactDOM.render(
  <Router history={hist}>
    <Routes>
      <Route path="/landing-page" component={LandingPage} />
      <RouteDashboard />
      <Route path="/profile-page" component={ProfilePage} />
      <Route path="/login-page" component={LoginPage} />
      <Route path="/" component={Components} />
    </Routes>
  </Router>,
  document.getElementById("root")
);
